import classes from './Dating.module.css'

const Dating = (props) => {

    let users = props.users.map(u =>
        <div key={u.id}> 
            <img src={u.photoURL} alt="ava" />
            <h3>{u.name}</h3>
        </div>
     );
    
    return (
        <div>
            <h2>Dating</h2>
        </div>
    )
}

export default Dating;
